def min_seconds_to_destroy_gemstones(n, gemstones):
    dp = [[float('inf') for _ in range(n)] for _ in range(n)]
    for i in range(n):
        dp[i][i] = 2
    for i in range(n - 1, -1, -1):
        for j in range(i + 1, n):
            dp[i][j] = min(dp[i][j], 1 + dp[i + 1][j])
            for k in range(j, i, -1):
                if gemstones[i] == gemstones[k]:
                    val1 = 1 if k - 1 < i + 1 else dp[i + 1][k - 1]
                    val2 = 0 if k + 1 > j else dp[k + 1][j]
                    dp[i][j] = min(dp[i][j], val1 + val2)
    return dp[0][n - 1]

